from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    sentence = ""
    for triple in triples:
        if sentence:
            sentence += f", which has a {triple.predicate} of {triple.object}"
        else:
            sentence += f"{triple.subject} has a {triple.predicate} of {triple.object}"
    return sentence

